import React from 'react';
import styled from 'styled-components';
import Link from 'next/link';
import logoImg from '../data/img/logo.png'
import titleImg from '../data/img/start_title_big.png'

const HOME = () => {
    return(
        <MainWrapper>
            <ImageCommon src={logoImg} alt="logoImg"/>
            <TitleImage src={titleImg} alt="titleImg"/>
            <TitleText>다가오는 2021년을 기다리며 다정페이와 함께<br/>한 해를 돌아보고 다정(情)펀딩을 해보시는 건 어떠신가요?</TitleText>
            <Link href="/main">
                <TitleButton>시작하기</TitleButton>
            </Link>
        </MainWrapper>
    )
}

const MainWrapper = styled.div`
    width : 532px;
    margin : 341px auto 0;
`

const ImageCommon = styled.img`
    margin : 0 auto;
    display : block;
`

const TitleText = styled.p`
    text-align : center;
    margin-top : 41px;
`

const TitleButton = styled.button`
    width : 200px;
    height : 60px;
    background-color : #ff6464;
    border : 0;
    border-radius : 50px;
    margin : 100px auto 0;
    display : block;
    color : white;
    font-size : 24px;
    outline : 0;
    box-shadow : 0px 0px 10px rgba(0, 0, 0, 0.5);

    &:active {
        border : 0;
        outline : 0;
    }
`

const TitleImage = styled(ImageCommon)`
    margin-top : 41px;
`

export default HOME;
